import React, {Component} from 'react';
import './App.css';

class App extends Component {
  render (){
    return (
        <div className="App">
          <div className="App-header">
            <h2>Welcome to React</h2>
          </div>
          <p className="App-intro">
            <p>This is a tut React app with Redux</p>
          </p>
        </div>
    );
  }
}

export default App;
